CREATE TABLE `pilot` (
  `id` BIGINT(20) NOT NULL  AUTO_INCREMENT,
  `fly_hour` INT(11) NOT NULL,
  `license_number` VARCHAR(50) NOT NULL,
  `name` VARCHAR(50) NOT NULL,
  PRIMARY KEY (`id` ASC),
  UNIQUE KEY `UK_sk71fi4dx8k8a21mbd93yj7kq` (`license_number` ASC)
) DEFAULT CHARSET=utf8 ENGINE=InnoDB;
CREATE TABLE `flight` (
  `id` BIGINT(20) NOT NULL  AUTO_INCREMENT,
  `destination` VARCHAR(50) NOT NULL,
  `flight_number` VARCHAR(50) NOT NULL,
  `origin` VARCHAR(50) NOT NULL,
  `time` DATE NOT NULL,
  `pilot_license_number` VARCHAR(255) NOT NULL,
  PRIMARY KEY (`id` ASC),
  KEY `FK3la8bbsoy9ck6byoqa6bntw1y` (`pilot_license_number` ASC),
  CONSTRAINT `FK3la8bbsoy9ck6byoqa6bntw1y` FOREIGN KEY (`pilot_license_number`) REFERENCES `pilot` (`license_number`) ON DELETE RESTRICT ON UPDATE RESTRICT
) DEFAULT CHARSET=utf8 ENGINE=InnoDB;
